syntax = "proto3";
package oidb_0x798;
    message Info {
        uint32 uint32_flag = 1;
        uint32 uint32_type = 2;
        uint32 uint32_count = 3;
    }
    message ReqBody {
        bytes feedsid = 1;
        uint64 uint64_time = 2;
        uint64 uint64_uin = 3;
        repeated uint32 uint32_type = 4;
    }
    message RspBody {
        uint32 uint32_result = 1;
        bytes errMsg = 2;
        repeated Info stInfos = 3;
        uint64 uint64_sleeptime = 4;
    }
